import React, { Component } from 'react';
import ReactDom from 'react-dom';
import axios from 'axios';
//引入组件
import { Layout } from 'antd';
import Content_first from './components/Content/目标转化事件/index';
import { SendOutlined } from '@ant-design/icons';
//引入css文件
import 'antd/dist/antd.css';
import './style.css';

const { Header, Footer, Content } = Layout;


class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            events:[],
            attrs:[]
        }

    }

    componentDidMount() {
        //接口请求数据
        //events
        axios.get('http://localhost:3000/events')
            .then((res) => {
                this.state.events = res.this.state
                // console.log(this.state.events)
            })
            .catch((err) => {
                console.log(err)
            })
        //attrs
        axios.get('http://localhost:3000/attrs')
            .then((res) => {
                this.state.attrs = res.this.state
                // console.log(this.state.attrs)
            })
            .catch((err) => {
                console.log(err)
            })
        //values
        axios.get('http://localhost:3000/values')
            .then((res) => {
                this.state.values = res.this.state
                // console.log(this.state.values)
            })
            .catch((err) => {
                console.log(err)
            })
    }
    render() {
        return (
            <Layout className='layout'>
                <Header className='header'>
                    归因分析
                </Header>
                <Content className='content'>
                    <h1 className='primarytitle'><SendOutlined className='icon1' />选择事件</h1>
                    <form>
                        <Content_first events={this.state.events} attrs={this.state.attrs} />
                    </form>
                </Content>
                <Footer className='footer'>
                    Footer
                </Footer>
            </Layout>
        )
    }
}

ReactDom.render(<App />, document.getElementById('root'))
